// components/PrintIFrame.tsx
import React, { useEffect, useRef } from 'react';

interface PrintIFrameProps {
  htmlContent: string;
  onFinished: () => void;
}

const PrintIFrame: React.FC<PrintIFrameProps> = ({ htmlContent, onFinished }) => {
  const iframeRef = useRef<HTMLIFrameElement>(null);

  useEffect(() => {
    const iframe = iframeRef.current;
    if (!iframe) return;

    const iframeDoc = iframe.contentDocument || iframe.contentWindow?.document;
    if (!iframeDoc) return;

    // ============================================================
    // COLE A STRING BASE64 COMPLETA DA SUA LOGO AQUI:
    // ============================================================
    const logoBase64 = "data:image/png;base64,";
    // ============================================================

    const printHtml = `
      <!DOCTYPE html>
      <html>
      <head>
        <meta charset="UTF-8">
        <title>Comprovante</title>
        <style>
          @page { 
            size: 80mm auto; 
            margin: 0; 
          }
          
          * { 
            margin: 0; 
            padding: 0; 
            box-sizing: border-box; 
          }
          
          body {
            width: 80mm;
            padding: 5mm;
            font-family: 'Courier New', monospace;
            font-size: 10pt;
            background: white;
            color: black;
            line-height: 1.4;
          }
          
          .logo-container {
            text-align: center;
            margin-bottom: 15px;
            padding-bottom: 10px;
            border-bottom: 2px dashed #000;
          }
          
          .logo-container img {
            max-width: 180px;
            height: auto;
            display: block;
            margin: 0 auto 8px auto;
          }
          
          .logo-text {
            font-size: 14pt;
            font-weight: bold;
            margin: 5px 0;
            letter-spacing: 1px;
          }
          
          .content {
            margin-top: 10px;
          }
          
          table { 
            width: 100%; 
            border-collapse: collapse; 
            margin: 10px 0; 
          }
          
          td, th {
            padding: 4px 2px;
            text-align: left;
          }
          
          .center { text-align: center; }
          .right { text-align: right; }
          .bold { font-weight: bold; }
          
          .total-line {
            margin-top: 10px;
            padding-top: 10px;
            border-top: 1px dashed #000;
          }
          
          .total { 
            font-size: 1.2em; 
            font-weight: bold; 
          }
          
          .footer {
            margin-top: 15px;
            padding-top: 10px;
            border-top: 1px dashed #000;
            text-align: center;
            font-size: 9pt;
          }
          
          @media print {
            body { 
              margin: 0;
              padding: 5mm;
            }
            .logo-container img {
              print-color-adjust: exact;
              -webkit-print-color-adjust: exact;
            }
          }
        </style>
      </head>
      <body>
        <div class="logo-container">
          <img id="logo" alt="Logo Cantinho da Bere" />
          <div class="logo-text">CANTINHO DA BERE</div>
        </div>
        
        <div class="content">
          ${htmlContent}
        </div>
        
        <script>
          const logoImg = document.getElementById('logo');
          const logoBase64String = "${logoBase64}";
          
          // Verifica se o base64 foi configurado
          if (logoBase64String && logoBase64String !== "COLOQUE_AQUI_A_BASE64_COMPLETA_DA_SUA_LOGO") {
            logoImg.src = logoBase64String;
            
            // Aguarda carregar a imagem antes de imprimir
            logoImg.onload = function() {
              setTimeout(() => {
                window.print();
              }, 500);
            };
            
            // Fallback se a imagem no carregar
            logoImg.onerror = function() {
              console.warn('Logo no carregou, imprimindo sem imagem');
              logoImg.style.display = 'none';
              setTimeout(() => {
                window.print();
              }, 500);
            };
          } else {
            // Se no tiver logo configurada, imprime sem ela
            console.warn('Logo no configurada');
            logoImg.style.display = 'none';
            setTimeout(() => {
              window.print();
            }, 500);
          }
        </script>
      </body>
      </html>
    `;

    iframeDoc.open();
    iframeDoc.write(printHtml);
    iframeDoc.close();

    // Listener para quando a impresso terminar
    const printWindow = iframe.contentWindow;
    if (printWindow) {
      printWindow.onafterprint = onFinished;
    }

  }, [htmlContent, onFinished]);

  return (
    <iframe
      ref={iframeRef}
      style={{ 
        display: 'none', 
        position: 'absolute', 
        left: '-9999px',
        width: '80mm',
        height: 'auto'
      }}
      title="Print Area"
    />
  );
};

export default PrintIFrame;